import {
  BrowserRouter as Router,
  Route,
  Routes,
  Navigate,
  useLocation,
} from "react-router-dom";
import Sidebar from "./components/Sidebar";
import Dashboard from "./components/Dashboard";
import CallLog from "./components/CallLog"; // Check for clarity in naming
import Messages from "./components/Messages";
import Location from "./components/Location";
import Header from "./components/Header";
import Employee from "./components/Employee";
import Register from "./components/Register";
import CallLogTable from "./components/CallLogTable";
import MessageDetails from "./components/MessageDetails";
import AttendanceTable from "./components/AttendanceTable";

// Private Route component (for protected routes)
const PrivateRoute = ({ children }) => {
  const auth = localStorage.getItem("user"); // Check if user is authenticated
  return auth ? children : <Navigate to="/register" />; // Redirect if not authenticated
};

function Layout() {
  const location = useLocation(); // This works inside Router
  return (
    <div className="h-screen flex flex-col">
      {/* Header */}
      <Header />

      <div className="flex flex-1">
        {/* Conditionally render Sidebar only if the current route is not /register */}
        {location.pathname !== "/register" && <Sidebar />}

        {/* Main Content */}
        <main className="flex-1 p-6 bg-gray-100 overflow-y-auto">
          <Routes>
            {/* Public Routes */}
            <Route path="/register" element={<Register />} />

            {/* Private Routes */}
            <Route
              path="/"
              element={
                <PrivateRoute>
                  <Dashboard />
                </PrivateRoute>
              }
            />
            <Route
              path="/call-logs"
              element={
                <PrivateRoute>
                  <CallLog /> {/* Ensure this is the desired component */}
                </PrivateRoute>
              }
            />
            <Route
              path="/messages"
              element={
                <PrivateRoute>
                  <Messages />
                </PrivateRoute>
              }
            />
            <Route
              path="/employees/:employeeId/call-logs"
              element={
                <PrivateRoute>
                  <CallLogTable />
                </PrivateRoute>
              }
            />
            <Route
              path="/message-details"
              element={
                <PrivateRoute>
                  <MessageDetails />
                </PrivateRoute>
              }
            />
            <Route
              path="/location"
              element={
                <PrivateRoute>
                  <Location />
                </PrivateRoute>
              }
            />
            <Route
              path="/employees"
              element={
                <PrivateRoute>
                  <Employee />
                </PrivateRoute>
              }
            />
            <Route
              path="/employees/:employeeId/attendance-list"
              element={
                <PrivateRoute>
                  <AttendanceTable />
                </PrivateRoute>
              }
            />

            {/* Catch-all Route for 404 */}
            <Route path="*" element={<Navigate to="/" />} />
          </Routes>
        </main>
      </div>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Layout />
    </Router>
  );
}

export default App;
